import Data from '../data/loginCredentials.json'
import pic from '../images/logo.jpg'
export default function LoginPage(){
    return(
        <>
        <div className='row'>
            <div className='col-lg-12'>
                <img src={pic} className='img-fluid d-block mx-auto'/>
            </div>
        </div>
        </>
    );
}
